function findId(data, idToLookFor) {
    var cardArray = data;
    for (var i = 0; i < cardArray.length; i++) {
        if (cardArray[i].Id == idToLookFor) {
            return({ "id": cardArray[i].Id, "gift": cardArray[i].GiftDestination });
        }
    }
}
